(417, '2015-09-24 14:28:30', '5', 'Dịch Vụ Cho thuê Xe', 'Cho Thuê Xe oto', 'Dịch Vụ cho thuê xe', 'Cho Thuê Xe Tự Lái', '', 'Dich VỤ CHO THUÊ XE ,Dịch vụ cho thuê xe du lịch , dịch vụ cho thuê xe tự lái đủ chủng loại dịch vụ tốt nhất giá thành rẻ từ các doanh nghiệp cho thuê xe', '<h2>Cho Thu&ecirc; Xe</h2>\n\n<p>Tổng hợp c&aacute;c dịch vụ cho thu&ecirc; xe tại Mua b&aacute;n xe hoi lii.vn</p>\n\n<h3>Dịch Vụ Cho thu&ecirc; Xe</h3>\n', 'cho-thue-xe-dich-vu-cho-thue-xe', 'MenuHeader', 1, 0, '41', '2', '', 0, 0, 0),
