(420, '2015-09-24 15:51:44', '5', 'Xe Hơi Ngập Nước Nỗi kinh hoàng của các Tài Xế', '0', '', '', '', '0', '<p>(<a href=\"http://lii.vn\">B&aacute;n Xe Hơi </a>lii.vn) <strong>Xe Hơi Ngập Nước</strong> Nỗi kinh ho&agrave;ng của c&aacute;c T&agrave;i Xế -&nbsp;<strong><a href=\"http://lii.vn\">Xe hơi</a></strong> l&agrave; 1 phần t&agrave;i sản c&oacute; gi&aacute; trị lớn , bạn c&oacute; thể cưng n&oacute; như trứng mỏng, x&oacute;t xa khi c&oacute; 1 vết trầy nhỏ, giận dữ khi c&oacute; đạo tặc bẻ kiếng&nbsp;chiếu hậu Nhưng những điều đ&oacute; sẽ kh&ocirc;ng l&agrave; g&igrave; khi m&agrave; xế cưng của m&igrave;nh chẳng may bị ngập nước &quot;<strong>Thủy K&iacute;ch</strong> Nỗi Kinh Ho&agrave;ng của T&agrave;i Xế&quot;&nbsp;</p>\n\n<p>Từ giữa th&aacute;ng 9 đến nay, nhiều trận mưa lớn k&eacute;o d&agrave;i đ&atilde; khiến cho nhiều khu vực tại TP. Hồ Ch&iacute; Minh v&agrave; H&agrave; Nội ch&igrave;m trong biển nước. H&agrave;ng loạt &ocirc; t&ocirc; bị ngập nước.</p>\n\n<p>Thiệt hại nặng nhất kể đến l&agrave; 20 chiếc &ocirc; t&ocirc; để trong tầng hầm của chung cư Green Hills (P. B&igrave;nh Hưng H&ograve;a B, Q. B&igrave;nh T&acirc;n, TP.HCM) bị ngập s&acirc;u, trong đ&oacute; phần lớn l&agrave; xe tiền tỷ. Tại H&agrave; Nội mới đ&acirc;y cũng đ&atilde; c&oacute; một số &ocirc; t&ocirc; đỗ trong tầng hầm t&ograve;a chung cư bị ngập nước gần tới n&oacute;c.<br />\nngập nước, thủy k&iacute;ch, động cơ, hệ thống, rủi ro, xử l&yacute;, thiệt hại, khắc phục, b&aacute;n xe, &ocirc; t&ocirc;, sửa chữa, ổn định, hoạt động, xe, nước.ngập-nước, thủy-k&iacute;ch, động-cơ, hệ -thống, rủi-ro, xử-l&yacute;, thiệt-hại, khắc-phục, b&aacute;n-xe, &ocirc;-t&ocirc;, sửa-chữa, ổn-định, hoạt-động.</p>\n\n<p style=\"text-align:center\"><img alt=\"Xe hơi ngập nước nỗi kinh hoàng của các tài xế\" longdesc=\"Xe hơi ngập nước nỗi kinh hoàng của các tài xế\" src=\"/upload/images/xehoingapnuoc.jpg\" style=\"height:183px; width:275px\" title=\"Xe hơi ngập nước nỗi kinh hoàng của các tài xế\" /></p>\n\n<h2 style=\"text-align:center\">Oto ngập nước c&oacute; thể hư hỏng trầm trọng</h2>\n\n<p style=\"text-align:center\">Anh internet</p>\n\n<p>Xe bị ngập nước thiệt hại v&ocirc; c&ugrave;ng lớn. Theo &ocirc;ng H&agrave; Minh Tuấn, Tổng gi&aacute;m đốc C&ocirc;ng ty AnyCar, chuy&ecirc;n kinh doanh xe cũ, nếu xe đ&atilde; bị ngập nước đến nắp capo th&igrave; c&oacute; thể xem như &ldquo;đồ bỏ&rdquo;.</p>\n\n<p>Nước đ&atilde; đến nắp capo th&igrave; động cơ, h&uacute;t gi&oacute; cũng bị ngập. Khi đ&oacute;, nước lọt v&agrave;o trong c&aacute;c xy-lanh, th&ocirc;ng qua hốc gi&oacute;, hoặc hệ thống xả v&agrave; nằm lại đ&oacute;.</p>\n\n<p>Cho d&ugrave; xe c&oacute; được mang đi xưởng để xử l&yacute;, nước đ&atilde; được r&uacute;t sạch ra khỏi xy-lanh, th&igrave; vẫn c&oacute; nguy cơ xy-lanh &ldquo;ngậm&rdquo; nước, nổ m&aacute;y vẫn c&oacute; thể bị hiện tượng thủy k&iacute;ch. Nếu xe bị thủy k&iacute;ch th&igrave; nhẹ nhất cũng phải dỡ m&aacute;y, thay tay bi&ecirc;n v&agrave; nặng l&agrave; lốc m&aacute;y vị vỡ, nứt th&igrave; phải thay động cơ.</p>\n\n<p>Trường hợp kh&ocirc;ng bị thủy k&iacute;ch, nhưng nguy cơ xy-lanh &ldquo;ngậm&rdquo; nước, cũng sẽ l&agrave;m cho l&ograve;ng xy-lanh c&oacute; thể bị gỉ. Như vậy, động cơ sẽ &quot;uống xăng như uống nước&quot; v&agrave; hoạt động kh&ocirc;ng ổn định.</p>\n\n<p>Ngo&agrave;i động cơ, c&aacute;c bộ phận kh&aacute;c cũng thiệt hại v&ocirc; c&ugrave;ng lớn. Nước sẽ ph&aacute; hỏng hoặc g&acirc;y trục trặc c&aacute;c bộ phận điện của xe. Hệ thống d&acirc;y điện chạy quanh th&acirc;n xe, c&aacute;c đầu nối sẽ bị nước th&acirc;m nhập, đặc biệt ở khu vực bệ trung t&acirc;m, để lại nhiều hậu quả sau n&agrave;y.<br />\nngập nước, thủy k&iacute;ch, động cơ, hệ thống, rủi ro, xử l&yacute;, thiệt hại, khắc phục, b&aacute;n xe, &ocirc; t&ocirc;, sửa chữa, ổn định, hoạt động, xe, nước.ngập-nước, thủy-k&iacute;ch, động-cơ, hệ -thống, rủi-ro, xử-l&yacute;, thiệt-hại, khắc-phục, b&aacute;n-xe, &ocirc;-t&ocirc;, sửa-chữa, ổn-định, hoạt-động.</p>\n\n<p style=\"text-align:center\"><img alt=\"oto Ngập nước vào những mùa mưa \" longdesc=\"oto Ngập nước vào những mùa mưa \" src=\"/upload/images/%C3%B4t%20ngap%20nuoc.jpg\" style=\"height:313px; width:490px\" /></p>\n\n<h3 style=\"text-align:center\">oto Ngập nước v&agrave;o những m&ugrave;a mưa</h3>\n\n<p>Bệ trung t&acirc;m l&agrave; khu vực chứa rất nhiều hệ thống điều khiển phức tạp như hộp số, hệ thống điều khiển đa năng th&ocirc;ng minh, đ&agrave;m thoại, t&uacute;i kh&iacute;,... khi bị ngập nước sẽ dẫn đến c&aacute;c hậu quả l&acirc;u d&agrave;i &nbsp;như hoạt động trục trặc, t&iacute;n hiệu kh&ocirc;ng ch&iacute;nh x&aacute;c, dễ bị chập ch&aacute;y.</p>\n\n<p>C&aacute;c bộ phận điều khiển bị ngập sớm nhất ch&iacute;nh l&agrave; những c&ocirc;ng tắc điều khiển ghế. Nước th&acirc;m nhập sẽ l&agrave;m hỏng c&aacute;c m&ocirc;-tơ, l&agrave;m t&ecirc; liệt bộ phận điều khiển ghế ngồi với xe c&oacute; ghế ngồi điều chỉnh điện.</p>\n\n<p>C&aacute;nh cửa xe bị ngập nước sẽ đọng rất nhiều nước b&ecirc;n trong, ảnh hưởng đến hệ thống loa v&agrave; d&acirc;y dẫn. Hệ thống chiếu s&aacute;ng cũng bị ảnh hưởng nặng nề. Cho d&ugrave; c&oacute; h&uacute;t sạch nước v&agrave; sấy kh&ocirc;, khả năng xảy ra c&aacute;c rủi ro sau n&agrave;y như đường d&acirc;y bị chập ch&aacute;y, hở, bị ăn m&ograve;n tại c&aacute;c tiếp điểm l&agrave; kh&oacute; tr&aacute;nh khỏi.</p>\n\n<p>Với nhiều d&ograve;ng xe, đặc biệt l&agrave; xe Nhật, hệ thống điều khiển t&uacute;i kh&iacute; đặt ngay dưới s&agrave;n xe ở khu vực bệ trung t&acirc;m. Nước lọt v&agrave;o c&oacute; thể l&agrave;m t&ecirc; liệt hoạt động của hệ thống n&agrave;y. T&uacute;i kh&iacute; sẽ kh&ocirc;ng bung khi c&oacute; va chạm, g&acirc;y nguy hiểm đến t&iacute;nh mạng.<br />\nngập nước, thủy k&iacute;ch, động cơ, hệ thống, rủi ro, xử l&yacute;, thiệt hại, khắc phục, b&aacute;n xe, &ocirc; t&ocirc;, sửa chữa, ổn định, hoạt động, xe, nước.ngập-nước, thủy-k&iacute;ch, động-cơ, hệ -thống, rủi-ro, xử-l&yacute;, thiệt-hại, khắc-phục, b&aacute;n-xe, &ocirc;-t&ocirc;, sửa-chữa, ổn-định, hoạt-động.</p>\n\n<p>Nội thất 1 chiếc &ocirc; t&ocirc; ngập nước bị th&aacute;o tung để sấy kh&ocirc;, trong trận &quot;đại hồng thủy&quot; năm 2008 tại H&agrave; Nội.</p>\n\n<p>Ngo&agrave;i ra, hệ thống truyền động cũng bị ảnh hưởng, bị nước l&agrave;m gỉ s&eacute;t dẫn đến hoạt động thiếu ổn định. C&ugrave;ng với đ&oacute; to&agrave;n bộ nội thất như ghế xe, trần, c&aacute;c tấm ốp đều phải dỡ ra, th&aacute;o tung sấy kh&ocirc;, c&aacute;i n&agrave;o hỏng phải bỏ v&agrave; thay mới...</p>\n\n<p>Những xe n&agrave;y, sau khi khắc phục hoạt động kh&ocirc;ng ổn định v&agrave; tin cậy, b&aacute;n rất kh&oacute;, cho d&ugrave; gi&aacute; v&ocirc; c&ugrave;ng rẻ, &ocirc;ng Tuấn cho biết. Theo &ocirc;ng Tuấn, thời gian qua 1 số xe ngập nước đến trung t&acirc;m kỹ thuật cả AnyCar tại H&agrave; Nội v&agrave; TP. Hồ Ch&iacute; Minh để kiểm tra, đ&aacute;nh gi&aacute;. T&ugrave;y từng trường hợp, mức độ nặng, nhẹ m&agrave; đ&aacute;nh gi&aacute; thiệt hại. Nhưng n&oacute;i chung, xe đ&atilde; bị ngập nước, để nước tr&agrave;n v&agrave;o khoang h&agrave;nh kh&aacute;ch th&igrave; thiệt hại nhẹ nhất cũng khoảng 30% gi&aacute; trị, c&ograve;n ngập nặng tới nắp capo như đ&atilde; n&oacute;i, th&igrave; coi như bỏ.</p>\n\n<p>Vụ mưa ngập hầm chung cư Green Hills vừa qua, chủ nh&acirc;n của chiếc Toyota Camry cho biết, xe mới mua, gi&aacute; 1,3 tỉ đồng. Đưa ra sửa chữa th&igrave; h&atilde;ng b&aacute;o thiệt hại khoảng 610 triệu đồng; hay chiếc xe Mercedes GL350 mang đến xưởng, cũng nhận được b&aacute;o gi&aacute; tổn ph&iacute; hơn 500 triệu đồng. Mức thiệt hại n&agrave;y tương đương với khoảng 1/3-/1/2 gi&aacute; trị xe. Tuy nhi&ecirc;n như đ&atilde; n&oacute;i, khắc phục xong, xe chưa chắc đ&atilde; hoạt động ổn định như trước. B&aacute;n lại rất kh&oacute; v&agrave; gi&aacute; rất rẻ, t&iacute;nh ra c&oacute; thể tiền khắc phục c&ograve;n lớn hơn tiền b&aacute;n xe thu được.</p>\n\n<p>Theo &ocirc;ng Tuấn, xe cũ c&oacute; 2 vấn đề lu&ocirc;n khiến người mua lo ngại, l&agrave; bị ngập nước, thủy k&iacute;ch v&agrave; bị tai nạn. Nếu kh&ocirc;ng c&oacute; kinh nghiệm, sẽ rất kh&oacute; ph&aacute;t hiện. V&igrave; vậy mua xe cũ, cần qua c&aacute;c trung t&acirc;m kỹ thuật, c&oacute; đầy đủ c&aacute;c thiết bị kiểm tra loại trừ những nguy&ecirc;n nh&acirc;n n&agrave;y.</p>\n\n<p>Trần Thủy</p>\n', '', 'Oto360', 1, 0, '0', '1', '', 0, 0, 0),
